?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Пожалуй, эта одна из старейших часовых марок во всем мире. И действительно, первые записи о компании датируются 1546 годом. Один из первых идейным основателем компании являлся известный часовщик Йозеф Голдерман (он был известен тем, что проектировал десять башен, расположенных в его городе), чья фамилия до сих пор сохранилась в названии бренда. Свое начало компания берет с города Тюбингена, где расположилась собственная мастерская Йозефа Голдермана. Качество данной компании даже обсуждать не стоит. Превосходное, нет, высочайшее&nbsp;качество гарантированно многовековыми традициями. Причем, компания следует и собственным разработанным традициям, и традициям, которые общепринято соблюдаются в немецком часовом деле. Стоит отметить, что компания Holdermann &amp; Sohn производит не только наручные часы, но также настенные и карманные. Марка соединяет старинные традиции вместе с современными тенденциями и идеями. И результат этого соединения – эталонные образцы часового искусства, которые могут поспорить за лидерство со многими швейцарскими марками. Часы Holdermann &amp; Sohn отличаются своей надежностью, высоким качеством, современным дизайном и элегантностью. Помимо этого, часы имеют водонепроницаемость до 10 АТМ.</span></span></p>
 
